//greeting card by App

function App() {
    let currDate = new Date(2021, 7, 31, 16);
    currDate = currDate.getHours();
    let greeting = " ";

    const cssStyle = {};

    if (currDate >= 1 && currDate < 12) {
        greeting = 'Good Morning';
        cssStyle.color = 'green';
    } else if (currDate >= 12 && currDate < 19) {
        greeting = 'Good Afternoon';
        cssStyle.color = '#6F1E51';
    } else {
        greeting = 'Good night';
        cssStyle.color = 'grey';
    }
    return (
        <>
            <div>
            <h1>Hello everyone, <span style={cssStyle}> {greeting} </span> </h1>
            <h1>Shruti here</h1>
           </div>
            <img src={img} alt="image" width='150px' height='200px' />
         
        </>
    );
}

export default App;
